import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

function App(){
    return(
        <div>
      <h1>Witaj, świecie!</h1>
      <h2>Jestem ambitna/y, więc przerabiam kurs React.js!</h2>
    </div>
    );


}


ReactDOM.render(<App />, document.getElementById('root'));
